import React from 'react'
import {useEffect} from 'react';
import Select from 'react-select'
import { Grid, TextField } from '@material-ui/core';
import Autocomplete from '@mui/material/Autocomplete';
import AsyncSelect from 'react-select/async';
const options = [
  { value: 'chocolate', label: 'Chocolate' },
  { value: 'strawberry', label: 'Strawberry' },
  { value: 'vanilla', label: 'Vanilla' }
]

function CountrySelect() {
    useEffect(() =>{
        const options = {
            method: 'GET',
            headers: {
                'X-RapidAPI-Key': 'dc0720bf5dmsh0994d16db11a6ebp1431bejsn8ba2ebb0a3eb',
                'X-RapidAPI-Host': 'countries-states-cities-dataset.p.rapidapi.com'
            }
        };
        
        fetch('https://countries-states-cities-dataset.p.rapidapi.com/list-countries', options)
            .then(response => response.json())
            .then(response => console.log(response))
            .catch(err => console.error(err));
    })
  return (
    <>
    <Autocomplete
      disablePortal
      id="combo-box-demo"
      options={options}
      sx={{ width: 300 }}
      renderInput={(params) => <TextField {...params} label="Movie" />}
    />
    </>
    
  );
}

export default CountrySelect;
